import React from 'react'
import { Link } from 'react-router-dom'

export default function Header() {
    return (
        <div className='header'>
            <ul>
                <Link to='/home'>Home</Link>
                <Link to='/projects'>Projects</Link>
                <Link to='/contacts'>Contacts</Link>
            </ul>
        </div>
    )
}
